// makerjs model, params -> profile toolpath

import * as params from '../parameters.js'
import * as mjs from 'makerjs';

const profile = (model) => {
  let p = model.models.profile;

  console.log(p);

  let expansion = mjs.model.expandPaths(p, params.compensatedRadius, 1);
  //let chains = mjs.model.findChains(expansion);
  let chain = mjs.model.findSingleChain(expansion);



  return new mjs.models.Rectangle(20, 30)
};


export {profile};
